import React,{uses} from 'react';
import TodoItem from './item'
const Yuti = (props) =>{
    // console.log(props.stateChat[0]);
    const{name,surname,id} = props.stateChat[0];
    return(
        <div>
        {name}
        {surname}
        {id}

        {todos.map(item => <TodoItem key={item.id} {...item} />)}
        </div>
    )
}
export default Yuti;
